int m = board.size();
int n = board.front().size();
const int dirs[4][2] = {{-1,0}, {1,0}, {0,1}, {0,-1}};

bool dfs(vector<vector<int>> &used, int i, int j, string &word, int idx){
  if(board[i][j] != word[idx]){
    return false;
  }else if(idx == word.length() -1){

    out_mat(used,"used");
    return true;
  }

  bool result = false;
  used[i][j] = idx;
  for(int k=0; k<4; k++){
    // cout<< "Find dir: "<< k+ 1<<endl;
    int new_i = i + dirs[k][0];
    int new_j = j + dirs[k][1];

    if(new_i >=0 && new_i < m && new_j >=0 && new_j < n &&  0 == used[new_i][new_j]){
      bool flag = dfs(used, new_i, new_j, word, idx+1);
      if(flag) {
	result = true;
	break;
      }
    }
  }
  
  used[i][j] = 0;
return result;
  
}

bool exist(vector<vector<char>>  &board, string word){
  vector<vector<int>> used(m, vector<int>(n, 0));

  for(int i = 0; i< m;++i)
    for(int j = 0; j< n; ++j){
      bool flag = dfs(used, i,j, word,1);
      if (flag) return true;
      }
    
  
  return false;
}

